(1047, 73, 1, 4, NULL, '/seecolor = Displays the current color setting for various messaging types.  Type /seecolor for usage.'),
(1048, 73, 1, 4, NULL, '/self tag &lt;on|off&gt; = Displays or hides your avatars overhead name from your view.'),
(1049, 73, 1, 4, NULL, '/setcolor = Allows setting of colors for various messaging types.  Type /setcolor for usage.'),
(1050, 73, 1, 4, NULL, '/sethud = Allows setting of various HUD display values.  Type /sethud for usage.'),
(1051, 73, 1, 4, NULL, '/spin = Causes your ship to spin on its axis.'),
(1052, 73, 1, 4, NULL, '/starbase reset  = Resets your character to a safe spot if stuck in a starbase.'),
(1053, 73, 1, 4, NULL, '/t &lt;player&gt; &lt;msg&gt; = Sends the specified player a private message.'),
(1054, 73, 1, 4, NULL, '/tell &lt;player&gt; &lt;msg&gt; = Sends the specified player a private message.'),
(1055, 73, 1, 4, NULL, '/time = Gives the current local time and the server time (GMT).'),
(1056, 73, 1, 4, NULL, '/who = Displays a list of all players in the starbase or sector you are in.'),
(1057, 73, 1, 4, NULL, '/list credit kill = Reports who a player is reassigning kill credit to and who is assigning kill credit to that player.');
